  def update_cache

    #Delete all records and rebuild - ensures previously 
    Subject.delete_all
    Qualification.delete_all

    #Update subjects
    formatted_subjects = []
    @subjects.each do |subject|
      formatted_subjects << {uuid: subject['id'], title: subject['title'], link: subject['link'], colour: subject['colour']} unless formatted_subjects.map{|s|s[:uuid]}.include?(subject['id'])
    end
    Subject.create(formatted_subjects)

    #Update qualifications
    formatted_qualifications = []
    @qualifications.each do |qualification|
      formatted_qualifications << {uuid: qualification['id'], name: qualification['name'], link: qualification['link'], subjects: Subject.where(uuid: qualification['subjects'].map{|s|s['id']}) || []} unless formatted_qualifications.map{|s|s[:uuid]}.include?(qualification['id'])
    end
    Qualification.create(formatted_qualifications)
  end

  def qualifications
    return @qualifications
  end
  def subjects
    return @subjects
  end

